import React from 'react';
import Header from './Header';
import '../App.css';

class NotFound extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <main>
          <h1>Página não encontrada</h1>
        </main>
      </div>
    );
  }
}

export default NotFound;
